import { Component, OnInit, OnDestroy } from '@angular/core';

@Component({
  selector: 'app-animes-page',
  templateUrl: './animes-page.component.html',
  styleUrls: ['./animes-page.component.scss']
})
export class AnimesPageComponent implements OnInit, OnDestroy {

  constructor(private animeService: AnimesService) {}

ngOnInit(){
  console.log('Me creo');
  this.animeService.getAnimes().subscribe((res: any) => {
    console.log(res.data);
  })
}


ngOnDestroy(){
  console.log('Me destuyo');


}}
